create table quests
(
    Id             int auto_increment
        primary key,
    NameId         int unsigned not null,
    StepIdsCSV     mediumtext   not null,
    CategoryId     int          not null,
    IsPartyQuest   tinyint      not null,
    RepeatType     int          not null,
    RepeatLimit    int          not null,
    IsDungeonQuest tinyint      not null,
    LevelMin       int          not null,
    LevelMax       int          not null,
    StartCriterion mediumtext   not null
)
    engine = MyISAM
    charset = utf8;

